import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

const mySkillsStyles = {
  container: {
    minHeight: '100vh',
    background: '#111',
    color: '#fff',
    padding: '2rem',
  },
  card: {
    background: '#222',
    borderRadius: '8px',
    boxShadow: '0 2px 16px rgba(0,0,0,0.5)',
    padding: '1.5rem',
    marginBottom: '1.5rem',
    maxWidth: '600px',
    marginLeft: 'auto',
    marginRight: 'auto',
    position: 'relative',
  },
  title: {
    fontSize: '1.3rem',
    fontWeight: 'bold',
    marginBottom: '0.5rem',
  },
  meta: {
    color: '#aaa',
    fontSize: '0.95rem',
    marginBottom: '0.5rem',
  },
  availability: {
    fontSize: '0.95rem',
    marginTop: '0.5rem',
  },
  deleteButton: {
    position: 'absolute',
    top: '1.5rem',
    right: '1.5rem',
    background: '#ff4d4f',
    color: '#fff',
    border: 'none',
    borderRadius: '4px',
    padding: '0.5rem 1rem',
    cursor: 'pointer',
    fontWeight: 'bold',
  },
};

function MySkills() {
  const [mySkillList, setMySkillList] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [errorMessage, setErrorMessage] = useState('');
  const navigate = useNavigate();

  const fetchMySkillListings = async () => {
    setIsLoading(true);
    setErrorMessage('');
    const token = localStorage.getItem('token');
    if (!token) {
      setErrorMessage('You must be logged in to view your skills.');
      setIsLoading(false);
      return;
    }
    try {
      const response = await fetch('http://localhost:5001/api/skills/mine', {
        headers: { Authorization: `Bearer ${token}` },
      });
      if (!response.ok) throw new Error('Failed to fetch your skill listings');
      const data = await response.json();
      setMySkillList(data);
    } catch (err) {
      setErrorMessage(err.message);
    } finally {
      setIsLoading(false);
    }
  };

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (!token) {
      navigate('/login');
    }
  }, [navigate]);

  useEffect(() => {
    fetchMySkillListings();
    // eslint-disable-next-line
  }, []);

  const handleDeleteSkill = async (skillId) => {
    const token = localStorage.getItem('token');
    if (!token) {
      setErrorMessage('You must be logged in to delete a skill.');
      return;
    }
    try {
      const response = await fetch(`http://localhost:5001/api/skills/${skillId}`, {
        method: 'DELETE',
        headers: { Authorization: `Bearer ${token}` },
      });
      if (!response.ok) throw new Error('Failed to delete skill');
      setMySkillList(mySkillList.filter(skill => skill._id !== skillId));
    } catch (err) {
      setErrorMessage(err.message);
    }
  };

  return (
    <div style={mySkillsStyles.container}>
      <h2 style={{ textAlign: 'center', marginBottom: '2rem' }}>My Skill Listings</h2>
      {isLoading && <div>Loading...</div>}
      {errorMessage && <div style={{ color: '#ff4d4f', textAlign: 'center' }}>{errorMessage}</div>}
      {mySkillList.map(skill => (
        <div key={skill._id} style={mySkillsStyles.card}>
          <div style={mySkillsStyles.title}>{skill.title}</div>
          <div style={mySkillsStyles.meta}>
            Category: {skill.category} | Type: {skill.type.charAt(0).toUpperCase() + skill.type.slice(1)}
          </div>
          <div>{skill.description}</div>
          {skill.availability && skill.availability.length > 0 && (
            <div style={mySkillsStyles.availability}>
              <strong>Availability:</strong> {skill.availability.join(', ')}
            </div>
          )}
          <button
            style={mySkillsStyles.deleteButton}
            onClick={() => handleDeleteSkill(skill._id)}
          >
            Delete
          </button>
        </div>
      ))}
      {!isLoading && mySkillList.length === 0 && !errorMessage && (
        <div style={{ textAlign: 'center', color: '#aaa' }}>You have not created any skill listings yet.</div>
      )}
    </div>
  );
}

export default MySkills;
